CREATE TABLE meteorite(id_meteo INT PRIMARY KEY,nom VARCHAR(20),type_meteorite VARCHAR(10),classe_meteo VARCHAR(10),masse DOUBLE,chute_observe VARCHAR(10),id_phénomene INT,id_localisation INT,id_date INT, 
FOREIGN KEY (id_phénomene) REFERENCES phenomenes(id_phénomene), FOREIGN KEY (id_localisation) REFERENCES localisation(id_local), FOREIGN KEY (id_date) REFERENCES date(id_date));

